Create database fp;
use fp;
CREATE TABLE FitnessNutrition (
    Id INT PRIMARY KEY AUTO_INCREMENT,
    detected_foods TEXT,
    calories FLOAT,
    protein_g FLOAT,
    carbs_g FLOAT,
    fat_g FLOAT,
    vitamins TEXT,
    pull_ups INT,
    push_ups INT,
    squats INT,
    jumps INT,
    pull_up_calories FLOAT,
    push_up_calories FLOAT,
    squat_calories FLOAT,
    jump_calories FLOAT,
    raw_llm_response TEXT,
    timestamp DATETIME DEFAULT CURRENT_TIMESTAMP
);
show tables;
